//Map method
//https://jsonplaceholder.typicode.com/posts

import { useEffect, useState } from "react";


function App(){
    const [data,setData]=useState
    useEffect(()=>{
        fetch("https://jsonplaceholder.typicode.com/posts")
        .then((res)=>{
            return res.json()
        })
        .then((res)=>{
            console.log(res)
        })


    })
    return(
        <div>
            <h1>Fetch data from backend</h1>
        </div>
    )
}
export default App;
